// data.js

const doctorClinicData = {
    '10001': {
        doctors: [
          { name: 'Dr. Anderson', specialty: 'Cardiologist' },
          { name: 'Dr. Martinez', specialty: 'Dermatologist' },
        ],
        clinics: [
          { name: 'HeartCare Clinic', address: '123 Oak St' },
          { name: 'SkinWell Clinic', address: '456 Maple St' },
        ],
      },
    '54321': {
      doctors: [
        { name: 'Dr. Brown', specialty: 'Pediatrician' },
        { name: 'Dr. Lee', specialty: 'Ophthalmologist' },
      ],
      clinics: [
        { name: "Kid's Clinic", address: '789 Oak St' },
        { name: 'Vision Care Center', address: '101 Pine St' },
      ],
    },
    // Add more data for other pin codes
  };
  
  export default doctorClinicData;
